function equalizeHeights() {
    var wrappers = document.querySelectorAll('.tishonator-wrapper');

    if (!wrappers.length) return; // Exit if no elements found

    var maxHeight = 0;

    wrappers.forEach(function(wrapper) {
        wrapper.style.height = 'auto';
    });

    wrappers.forEach(function(wrapper) {
        if (wrapper.offsetHeight > maxHeight) {
            maxHeight = wrapper.offsetHeight;
        }
    });

    wrappers.forEach(function(wrapper) {
        wrapper.style.height = maxHeight + 'px';
    });
}

window.onload = equalizeHeights;

// Throttle resize events
window.onresize = function() {
    clearTimeout(window.resizedFinished);
    window.resizedFinished = setTimeout(equalizeHeights, 250);
};